import { useEffect, useState } from 'react';
import "./App.css";
import axios from 'axios';
import "./App.css";
import Header from "./components/Header.js"
import SearchBar from "./components/SearchBar.js";
import Footer from "./components/Footer.js"

function App() {
  return (
    <>
      {/* Header */}
      <Header />

      {/* Search Bar */}
      <div class="chow">
        <input type="text" id="myInput" onChange= {handleChange()} placeholder="Search for names" title="Type in a name"></input>
      </div>


      <TableRows/>
      <Footer></Footer>

    </>
  );
}




export default App;
